import Layout from '../components/Layout'
import Head from 'next/head';

const Index = () => {

    return (
        <div>
            <Head>
                <title>Tyler's Personal Site</title>
                <meta
                    name="resume"
                    content="initial-scale-1.0, width=device=width"
                    key="resume"
                />
            </Head>


        </div>
    );

}

export default Index;
